import 'bootstrap/dist/css/bootstrap.min.css';

//font awesome
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'

class Dare extends Component{
  render(){
    return(
      <div class="container" id="dareContainer">
        <div class="row">
          <div class="col">
            1{this.props.text}
          </div>
        </div>
      </div>
    );
  }
}

